    contours, hierarchy = cv2.findContours(edges, cv2.RETR_TREE, cv2.CHAIN_APPROX_SIMPLE)
    for cnt in contours:
        cv2.drawContours(drawing, [cnt], 0, (0, 255, 0), 10)
        cv2.drawContours(student_image, [cnt], 0, (255, 255, 255), 10)
        cv2.imshow('Mask of correct image', drawing)
        cv2.imshow('Result', student_image)
    cv2.imshow('Correct image', correct_image)


